Tire le meilleur parti de tes enceintes portables Wi-Fi/Bluetooth BLAST et MEGABLAST avec Alexa intégrée. Configure le contrôle vocal, personnalise l’égaliseur, règle le volume et associe jusqu'à 8 enceintes BLAST et MEGABLAST pour un son plus puissant et plus immersif!

L'application te permet:
- de coupler jusqu'à 8 enceintes BLAST et MEGABLAST pour obtenir un son plus puissant et plus immersif, ou 2 enceintes pour un son stéréo;
- de personnaliser ton son avec les réglages de l'égaliseur; 
- de contrôler le volume à distance; 
- de régler le temps de veille pour optimiser la longévité ou les performances de la batterie;
- d'ajouter et de gérer des réseaux Wi-Fi;
- de vérifier la charge de la batterie;
- de configurer et d'activer Amazon Alexa;
- de définir la langue pour Alexa.

Remarque: BLAST et MEGABLAST utilisent le Wi-Fi pour le couplage et ne peuvent pas être couplées avec d'autres enceintes Ultimate Ears. BLAST et MEGABLAST ne peuvent pas être couplées avec les enceintes BOOM, MEGABOOM, ROLL ou WONDERBOOM.
